export default {
    getUser: (state) => state.user,
    getUsername: (state) => state.username,
    getIsLogin: (state) => state.isLogin,
    getUserId: state => state.userId,
    getErrorState: state => state.errorState,
    getIsAuth: state => state.isAuth,
    loggedIn(state) {
        return !!state.user
    }
}
